    function canvasClipEvent(manPicArr, callback){
        var arr = manPicArr;
        var imgArr = [];
        init();
        function init(){
            for(var i=0,len=arr.length; i<len; i++){
                if(arr[i]==''){
                    imgArr.push({
                        img: '',
                        status: 'ok',
                        index: i,
                        src: '0'
                    })
                }else{
                    var img = new Image();
                    img.index = i;
                    img.onload = function(){
                        imgArr.push({
                            img: this,
                            status: 'ok',
                            src: '',
                            index: this.index
                        })
                    }
                    img.onerror = function () {
                        img.status = 'err';
                    };
                    img.src = arr[i];
                }
            }
            setTimeout(updataCanvas, 20);
        }
        function updataCanvas(){
            var max = 0;
            var n = 0;
            var p;
            for(var i in imgArr){
                p = imgArr[i];
                if('status' in p){
                    max++;
                    if (p.status.indexOf('ok') != -1 || p.status.indexOf('err') != -1)n++;
                }
            }
            r = n / max;

            if (r < 1) {
                setTimeout(updateCanvas, 50);
            }else{
                initCanvas();
            } 
        }
        function initCanvas(){
            var arr = new Array(imgArr.length);
            for(var i in imgArr){
                if(imgArr[i].img!=''){
                    var src = clipImage(imgArr[i].img);
                    imgArr[i].src = src;
                }
                arr.splice(imgArr[i].index, 1, imgArr[i].src);
            }
            callback(arr);
        }
        function clipImage(image){
            var canvas = document.createElement('canvas');
            canvas.width = 215;//CSS中定义了画布是580
            canvas.height = 204;
            var ctx = canvas.getContext('2d');
            ctx.fillStyle = 'transparent';//绘制背景色
            ctx.fillRect(0,0,canvas.width,canvas.height);

            ctx.drawImage(image,59,186,215,204,0,0,215,204);
            //直接合成图片
            var base64 = canvas.toDataURL('image/png');
            return base64;  
        }
    }
