/**
 * ajax封装
 * option{
 * url 发送请求的地址
 * data 发送到服务器的数据，数组存储，如：{"date": new Date().getTime(), "state": 1}
 * async 默认值: true。默认设置下，所有请求均为异步请求。如果需要发送同步请求，请将此选项设置为 false。
 *       注意，同步请求将锁住浏览器，用户其它操作必须等待请求完成才可以执行。
 * type 请求方式("POST" 或 "GET")， 默认为 "GET"
 * dataType 预期服务器返回的数据类型，常用的如：xml、html、json、text,默认json
 * timeout 请求时间
 * beforeSend 加载前
 * complete 加载结束
 * successfn 成功回调函数
 * errorfn 失败回调函数
 * }
 * $.ax(option);
 */
;(function($){

    $.ax=function(option) {
        var opt = {
            url : '',
            data : {},
            type : 'get',
            async : 'true',
            dataType : 'json',
            timeout: 15000,
            success: function(d){
                // console.log(d);
                // Dialog.message.show('网络异常，请刷新重试。');
            },
            error: function(e){
                // console.log(e);
                alert('网络异常，请刷新重试。');
            },
            beforeSend: function(){
                // Dialog.childload.show();//打开加载层
            },
            complete : function(){
                setTimeout(function(){
                // Dialog.childload.hide();//关闭加载层
                // Route.showMainPage();                    
                },400)

            }
        }
        $.extend(opt, option);
        $.ajax({
            type: opt.type,
            async: opt.async,
            data: opt.data,
            url: opt.url,
            dataType: opt.dataType,
            timeout: opt.timeout,
            success: function(d){
                opt.success(d);
            },
            error: function(e){
                opt.error(e);
            },
            beforeSend:function(){
                opt.beforeSend();
            },
            complete:function(data){
                opt.complete();
            },

        });
    };
})(jQuery);


var Marquee = (function(){
    function horiScroll(id){ //横向滚动
        try{document.execCommand("BackgroundImageCache", false, true);}catch(e){};
        var container = document.getElementById(id),
        original = container.getElementsByTagName("dt")[0],
        clone = container.getElementsByTagName("dd")[0],
        speed = arguments[1] || 10;
        clone.innerHTML=original.innerHTML;
        $('#'+id+' dl').width($('#'+id+' dt').width()*2+200);
        var rolling = function(){
          if(container.scrollLeft == clone.offsetLeft){
            container.scrollLeft = 0;
          }else{
            container.scrollLeft++;
          }
        }
        var timer = setInterval(rolling,speed)//设置定时器
        // container.onmouseover=function() {clearInterval(timer)}//鼠标移到marquee上时，清除定时器，停止滚动
        // container.onmouseout=function() {timer=setInterval(rolling,speed)}//鼠标移开时重设定时器

    }
    function vertiScroll(id){ //纵向滚动
        try{document.execCommand("BackgroundImageCache", false, true);}catch(e){};
        var container = document.getElementById(id),
        original = container.getElementsByTagName("dt")[0],
        clone = container.getElementsByTagName("dd")[0],
        speed = arguments[1] || 10;
        clone.innerHTML=original.innerHTML;
        $('#'+id+' dl').height($('#'+id+' dt').height()*2+200);
        var rolling = function(){
          if(container.scrollTop == clone.offsetHeight){
            container.scrollTop = 0;
          }else{
            container.scrollTop++;
          }
        }
        var timer = setInterval(rolling,speed)//设置定时器
        // container.onmouseover=function() {clearInterval(timer)}//鼠标移到marquee上时，清除定时器，停止滚动
        // container.onmouseout=function() {timer=setInterval(rolling,speed)}//鼠标移开时重设定时器
    }
    return {
        horiScroll : horiScroll,
        vertiScroll : vertiScroll
    }
})();


