var Setting = (function(){
    function init(){
        initAdver();
        initMusicPart();
        // initHeadScroll();

    }
    // 初始化顶部滚动
    function initHeadScroll(){
        if(PageData.isOpenBarrage.v == '1'){
            $.ax({
                type: params.requestMethod,
                url: params.winnerListUrl,
                success: function(data){
                    if(data.winnerdata.length > 0){
                        var dtCon = '';
                        for(var i =0,len = data.winnerdata.length; i<len; i++){
                            dtCon += '<span>'+data.winnerdata[i].winmsg+'</span>';
                        }
                        var content = '<div class="head-scroll fs-small"><div class="w80" id="headScroll">'+
                            '<dl>'+
                                '<dt>'+dtCon+'</dt>'+
                                '<dd></dd>'+
                            '</dl>'+
                        '</div></div>';
                        $('#wrapperMain').append(content);
                        Marquee("headScroll",50); 
                    }

                }
            });
        }
    }
    //广告页初始化
    function initAdver(){
         
        if(settings.advert != null && settings.advert.length > 0 ){//广告页初始化判断
            var imgCon = '';
            var imgArr = settings.advert;
          
            for(var i=0,len=imgArr.length; i<len; i++){
                imgCon += '<div class="swiper-slide"><img src="'+imgArr[i]+'" /></div>'
            }
            var adverCon = 
            '<div class="adver"><div class="swiper-container adver-swiper">'+
                '<div class="swiper-wrapper">'+
                    imgCon+                
                    '<div class="swiper-slide"><img src="../addons/zofui_chickenwish/public/images/o.png" /></div>'+
                '</div>'+
            '</div>'+
            '<div class="pre-wrap"><div class="pre-box1"><div class="pre1"></div></div><div class="pre-box2"><div class="pre2"></div></div></div></div>'
            $('body').append(adverCon);
            
            var swiper = new Swiper('.adver-swiper', {
                paginationClickable: true,
                direction: 'vertical',
                onReachEnd: function(swiper){
                    $(".adver").hide();
                    setTimeout(function(){
                    },800);
                }
            });
        }
    }
    //音乐部分    
    function initMusicPart(){
        
        document.addEventListener("WeixinJSBridgeReady", function (){
            WeixinJSBridge.invoke('getNetworkType', {}, function (e) {
                document.getElementById('bgMusic').play();
            }, false);
         });
    } 

    function initDetailMusicPart(){
        if(PageData.detailBgMusic&&PageData.detailBgMusic.v!=''){
            var bgMusic = PageData.detailBgMusic.v;
            var bg = PageData.bgMusicImage.v;
            // var bgMusic = 'http://res2.playwx.com/wechat/app/201602/01182953_36jQ.mp3';
            // var bg = 'http://upload.aduu.cn/970/970_riQUBaECa0DcuSF.png';
            $('body').append('<div id="detailMusicPart"><div class="music-btn music-btn-ani" id="musicBtn1" style="background-image:url('+bg+')"></div><audio class="dn" id="bgMusic" src="'+bgMusic+'" loop autoplay preload controls></audio></div>');
            document.addEventListener("WeixinJSBridgeReady", function (){
                WeixinJSBridge.invoke('getNetworkType', {}, function (e) {
                document.getElementById('bgMusic').play();
                }, false);
            });
            $('#musicBtn1').on('click', function(){
                var bgMusic = document.getElementById('bgMusic');
                if($(this).hasClass('music-btn-ani')){
                    $(this).removeClass('music-btn-ani');
                    bgMusic.pause();
                }else{
                    $(this).addClass('music-btn-ani');
                    bgMusic.play();
                }
            });
        }
    }
    return {
        init : init,
        initDetailMusicPart:initDetailMusicPart
    }
})();